(224, '95 говорят заработает щас', ''),
(232, 'Внимание!!!\r\nПо экстренным вопросам и ситуациям в 1С Розница обращаться по номеру: 8-913-379-97-77.', ''),
(234, 'Сегодня (18.11.14) обновление поставили на розницу, исправили ошибку при возврате\r\nпо потребкредиту - исправлено округление.\r\n', ''),
(235, 'Карпенко (15:52:12 18/11/2014)\nзавтра возможны перебои с электричеством в вашем здании в период с 9-00 до 16-00, срок отключения может быть до 2 часов (ориентировочно). Примите к сведению при планировании работы', ''),
(246, 'Ноуты привезли, разберайте...', ''),
(248, '19.11.14 с 7:00 Не работает рассрочка, the bat, не проходит обмен.', ''),
(249, 'А 121 будет сегодня????', ''),
(262, 'Нужно запустить 95-ый', ''),
(266, 'Программисты прислали сообщение. Кто занимался данной проблемой, просьба сообщить Никите\nЗаявка:\n"\nshop14@krs.obuvrus.ru\nудалить не проведенные документы\nЗдравствуйте, 911. \n\nУ нас с 1 октября накопилось 30 непроведенных документов которые \nнужно удалить.после анулирования продажи они остаются висеть в \nпрограмме. \n\n\nКомментарий оставил:\n11.11.2014 17:22:41 Свиридов Дмитрий Викторович это что?\n\nЭто они имели ввиду, что когда у них чеки отложенные по рассрочке аннулируются, то они у них отображаются в продажах за период как непроведенные и они их хотят удалить. Мы им обычно объясняем, что они нигде не отображаются и просто на них внимания не обращайте.\n\n///////////////////////\nВроде как 2-й дежурный занимается такой заявкой пусть инфу всю соберет и мне расскажет про эту заявку. \n"', ''),
(270, '20.11.2014 запланирована настройка Online режима в ОП Кемерово.', '10.10.6.110'),
(271, 'Если возникла проблема с обменом необходимо:\n-  Передать Ване <b>Полное имя магазина, ID и пароль от кассовой зоны</b>\n\n<span>Данная информация актуальна на 20.11.2014г.</span>', '10.10.6.110'),
(273, 'После перевода на Online режим необходимо написать заявку на Юрченко Евгения (IP 6114) с прекрипленными сканами z отчетов на момент перевода.', '10.10.6.110'),
(274, 'Исправили Ошибку (Россита)\n<b>\nSoapServise.MSSoapInit(СокрЛП(Константа.АдресВебСервиса), "ExtNetExchange", "ExtNetExchangeSoap"); \n{Обработка.ОплатаРассрочка.Форма.Модуль(40)}: WSDLReader: WSDLReader:XML Parser failed at linenumber 0, lineposition 0, reason is: System error: -2146697208.\nHRESULT=0x1: Неверная функция.\n - WSDLReader:Loading of the WSDL file failed HRESULT=0x80070057: Параметр задан неверно.\n - Client:One of the parameters supplied is invalid. HRESULT=0x80070057: Параметр задан неверно.<b>', '10.10.6.110'),
(275, ' <b>(offline режим) </b>\n 1) Где взять актуальные цены (прайс отправить нет возможности)\n .. Ответ:\n .. Актуальную цену необходимо уточнить у Товароведа (если нет, то директора).\n 2) Нет остатков \n .. Ответ:\n .. (их и не должно быть. Контроль не ведется)\n 3) Нет продавцов\n .. Ответ:\n .. Их и не должно быть (нет поля ввода). Читать инструкцию!!! ', '10.10.6.110'),
(276, 'Бухгалтер ОП Москва  просила не вносить никаких изменений в базы магазинов без согласования с бухгалтерией.', '10.10.6.84'),
(277, 'Для для ОП, которые переведены на режим Online необходимо обновить конфигуратор (в базе offline).\nВся необходимая информация находится по ссылке:\nhttp://10.10.6.110/instruction/Online/index.php\n<h3><b>1Cv8off(Обновление конфигуратора).rar</b></h3>  ... - обновление конфигуратора\n<h3><b>Обновление конфигурации офлайн базы.doc</b></h3> - Инструкция по обновлению', '10.10.6.110'),
(278, 'Необходимо создать копию рабочих мест в ОП с режимом работы Online\nИнструмент для создания и востановления можно найти на http://10.10.6.110/instruction/Online/index.php\nФайл с названием: <h3><b>"Востановление Рабочего места.zip"</b></h3>', '10.10.6.110'),
(279, 'Программисты просили не включать ничего магазинам если какие-то функции у них отключены (оформление договоров рассрочки например)!!! Информацию можно получить у Жачука, если будут вопросы.', '10.10.6.60'),
(280, '<h1><b>Прошу ознакомиться с новой инструкцией по работе с ФР (отложенные чеки)</b></h1>\nhttp://10.10.6.110/instruction/Инструкция по отложенным операциям.odt', '10.10.6.110'),
(281, '<h2>\n	<span style="font-size:24px;"><span style="font-family:arial,helvetica,sans-serif;"><strong>На сайте 10.10.6.110 обновилась инструкция по работе в офлайн базе.</strong></span></span></h2>\n<p>\n	<strong><span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;">Инструкцию можно скачать по ссылке :</span></span></strong></p>\n<p>\n	<span style="font-size:16px;"><span style="font-family:arial,helvetica,sans-serif;"><a href="http://10.10.6.110/instruction/Online/Инструкция по работе в оффлайн режиме.odt">http://10.10.6.110/instruction/Online/Инструкция по работе в оффлайн режиме.odt</a></span></span></p>\n', '10.10.6.110'),
(285, 'Внимание сегодня будет работать 121! Приглашаю всех желающих :)\n', '10.10.6.121'),
(286, '<h2><b>13.12.2014  будет  день  рождение  у  ведущего программиста Соловьевой Елены. </b></h2>\n<h1><b>Просьба сдать на подарок.</b></h1>', '10.10.6.110'),
(287, 'Сейчас есть магазины с задвоившейся суммой продаж за наличные в ДДС (Сам отчет и ПКО на такую же сумму). Программистами проблема решается, примерно во вторник должны исправить, сейчас ничего не делаем.', '10.10.6.84'),
