(294, 'ООО "Дион"\nООО "Интегра"\nООО "МодернШуз"\nООО "МИРАСТИЛЬ"\nООО "ТД Россита"\nООО "СтильМаркет"\nЭти юр. лица без НДС, у все остальных с НДС', '10.10.6.110'),
(295, 'Зарегистрированный фискальный регистратор на ООО Дион будет на данном магазине 5 мая до 17.00.\nНа данном магазине останется старый фискальный регистратор на предыдущее юр.лицо (ООО "МФО") для сбора платежей по рассрочке.\nПрошу произвести соответствующую настройку 1С.\n15Ом/СЗ-0003827\nКолоколов Алексей Александрович\nОмск ОП', '10.1.12.1'),
(296, 'Сообщаем Вам, что 30 апреля - плановая дата перевода еще двух магазинов ОП г.Омск на ООО "Дион":\n1. "Emilia Estra" пр. Маркса, 39\n2. "Emilia Estra" пр. Мира, 46\nЗарегистрированные фискальные регистраторы на ООО Дион будут на данных магазинах 29 апреля до 17.00.\nНа данных магазинах НЕ останется старый фискальный регистратор на предыдущее юр.лицо (ООО "МФО") для сбора платежей по рассрочке.\nПрошу произвести соответствующую настройку 1С.\n15Ом/СЗ-0003822\nКолоколов Алексей Александрович\nОмск ОП', '10.1.12.1'),
(297, 'С «15» мая 2015 г. в ОП Курск планируется открытие магазина «Вестфалика» по адресу:                \nг. Орел, ул. 1-ая Посадская, 15 (ООО «МФО»).\n', '10.1.12.1'),
(298, '<h3><b>Внимание!!!</b></h3>\nДата перевода ОП Владивосток на Online режим <b>13.05.2015</b>.', '10.1.12.1'),
(299, 'Сейчас у магазинов после закрытия смены по ДДС задваиваются Оплаты платежной системой НКО избавиться от задвоения можно перепроведением документа "прием платежей". Во вторник проблема должна быть решена', '10.1.12.1'),
(300, '01.06.2015 Были изменены правила переноса документа "Отчет о розничных\nпродажах"  из  трейд в УПП. Новый правила находятся по старому адресу:\n"Z:\\IT\\Внешние обработки\\Обработка выгрузки ОРП из Росситы".\n\nБУДЬТЕ ВНИМАТЕЛЬНЫ, ПОЖАЛУЙСТА!\n', '10.1.12.1'),
(301, '8-952-941-51-93 Евгений Юрченко\n\n8-953-762-69-84 Жуков Алексей', '10.1.12.41'),
