(303, 'Платежи на одинаковую сумму и на одинаковый номер/договор и т.д. нельзя делать в течении часа, защита от дублирующих. Если надо провести платеж 2 раза пусть сумму изменят хоть на рубль', '10.1.12.41'),
(304, 'Платежи на одинаковую сумму и на одинаковый номер/договор и т.д. нельзя делать в течении часа, защита от дублирующих. Если надо провести платеж 2 раза пусть сумму изменят хоть на рубль', '10.1.12.41'),
(305, '<center><h2>ВНИМАНИЕ!!!</h2></center>\nВсе нормативные документы и инструкции хранятся в ДО, внутренние документы -> Нормативные документы компании -> Стандарты и технологии', '10.1.12.41'),
(306, 'Дежурные праздничные дни\n1.01.2016  \nЖачук В.\nСироткин М.\n2.01.2016  \nЖачук В.    - 8-903-939-04-04 (УПР)\nСироткин М. - 8-923-704-17-48 (УРП)\n3.01.2016  \nЖачук В.    - 8-903-939-04-04 (УПР)\nСироткин М. - 8-923-704-17-48 (УРП)\n4.01.2016  \nЖачук В.    - 8-903-939-04-04 (УПР)\nЮрченко Е.  - 8-952-941-51-93 (УРП)\n5.01.2016  \nЖачук В.    - 8-903-939-04-04 (УПР)\nЮрченко Е.  - 8-952-941-51-93 (УРП)\n6.01.2016  \nПономарев В.- 8 913 451 17-19 (УПР)\nЮрченко Е.  - 8-952-941-51-93 (УРП)\n7.01.2016  \nПономарев В.- 8 913 451 17-19\nЖуков А.    - 8-953-762-96-84 (УРП)\n8.01.2016  \nПономарев В.- 8 913 451 17-19 (УПР)\nЖуков А.    - 8-953-762-96-84 (УРП)\n9.01.2016  \nПономарев В.- 8 913 451 17-19 (УПР)\nСироткин М. - 8-923-704-17-48 (УРП)\n10.01.2016  \nПономарев В.- 8 913 451 17-19 (УПР)\nЖуков А.    - 8-953-762-96-84 (УРП)\n', '10.1.12.41'),
(307, '1. В справочнике "ЭквайринговыеТерминалы" добавлен реквизит "КассовоеРешениеВТБ24" - используется для автоматической проверки и исправления настроек терминала втб24.\n2. Добавлен "РегистрСведений.ДополнительнаяСистемнаяИнформация" - в него записывается информация о проверки терминала ВТб24 и его настройки.\n3. Проверка терминала втб24 добавлена при продаже/оплате/возврате по платежной карте.\n4. Изменен механизм проведение продажи и оплаты по платежным картам: \n 4.1. Разделены операции пробития по терминалу эквайринга и по фискальному регистратору. \n 4.2. В случаи возникновения ошибки на ФР при проведения операции, теперь формируется отложенный чек. После устранения ошибки на ФР можно продолжить пробитие чека на ФР. \n 4.3. Убрали программное аннулирование последней операции в случаи ошибки. Необходимо использовать механизм отложенных чеков.\n5. Встроен новый модуль НКО - убрана ошибка с дублированием суммам.\n6. В "Документ.ЧекККМ.Форма.ИС_ФормаВозвратаНоваяУпр" - Исправлено заполнение номера документа продажи. Что в свою очередь исправляет поиск договора продажи платежной карты.\n7. В "ОбщаяФорма.ФормаОплатаЭквайринговыйТерминал" - Добавлен параметр "Договор эквайринга". Передача его в форму влечет за собой фильтрацию выводимых эквайреров по договору.\n8. Добавлена кнопка печати слип-чека в отложенных чеках - информационный чек. \n9. Удалено "РегламентноеЗадание.ппОбновлениеСправочниковУслуг" - у нас не используется.', '10.1.12.41'),
(308, 'Жачук В. - 8-903-939-04-04\nЗавьялов И. - 8-913-209-00-88\n              8-913-951-41-26\nСвиридов Д. - 8-983-138-40-63\n\nШевалье С.  - 8-913-951-39-89', '10.1.12.1'),
